Hydra (2009)


Op een eenzaam eiland, willen een scrupuleuze wetenschapper en zijn gasten, vier jonge misdadigers tijdens een bloedige mensenjacht doden. Wat echter niemand vermoedt is dat op het eiland nog een andere &quot;jager&quot; schuilt.

